<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta httpEquiv="Content-Type" content="text/html; charSet=utf-8" />
    <meta httpEquiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    <title>Error 429 - Internal Server Error</title>
    <link rel="stylesheet" href="https://use.typekit.net/ovf1fpe.css" />
    <style type="text/css">
      :root {
        --font-family: "proxima-nova", "helvetica", "arial", sans-serif;
        --body-background: #f6fefb;
        --body-color: #333942;
        --green800: #004038;
        --green-600: #00756a;
        --cta-color: #ffffff;
        --title-font-size: 7.2rem;
        --title-line-height: 8.8rem;
        --subtitle-font-size: 2.4rem;
        --subtitle-line-height: 3.6rem;
        --notes-font-size: 1.6rem;
        --notes-line-height: 2.4rem;
      }

      html,
      body {
        height: 100%;
      }

      html {
        font-size: 62.5%;
      }

      body {
        background: var(--body-background);
        font-family: var(--font-family);
        color: var(--body-color);
        font-size: 2rem;
        font-weight: 400;
        margin: 0;
        padding: 0;
      }

      .container {
        display: flex;
        align-items: center;
        justify-content: center;
        height: calc(100vh - 150px);
        flex-direction: column;
        text-align: center;
        padding: 0 16px;
        max-width: 1200px;
        margin: 0 auto 30px;
      }

      img {
        max-width: 100%;
      }

      .header {
        padding: 24px 0;
        text-align: center;
        margin: 0 0 30px;
      }

      /* Typography */
      h1 {
        font-size: var(--title-font-size);
        line-height: var(--title-line-height);
        color: var(--green800);
        margin: 32px 0;
        padding: 0;
      }

      a {
        color: var(--green800);
        text-decoration: underline;
      }

      p {
        font-size: var(--subtitle-font-size);
        line-height: var(--subtitle-line-height);
        margin: 0;
        padding: 0;
      }

      .btn-wrapper {
        margin: 48px 0;
      }

      .btn {
        display: inline-block;
        font-size: 19px;
        line-height: 23px;
        font-weight: 700;
        border-radius: 8px;
        height: 64px;
        padding: 0;
        transition: all 0.3s ease-out;
        position: relative;
        text-decoration: none !important;
      }

      .btn .foreground {
        display: block;
        position: relative;
        top: 0;
        height: auto;
        color: #ffffff;
        background-color: var(--green800);
        border-radius: 8px;
        padding: 21px 32px;
        text-align: center;
        text-wrap: nowrap;
        transition: transform 0.3s ease-out, background-color 0.3s ease-out;
        z-index: 1;
      }

      .btn .foreground:after {
        content: url("https://www.workable.com/static/images/ui/btn-icons/arrow-white-right.svg");
        display: inline-block;
        position: relative;
        top: 2px;
        right: -16px;
        margin-right: 12px;
      }

      .btn .background-wrapper {
        position: absolute;
        inset: 0;
        display: block;
        overflow: hidden;
      }

      .btn .background {
        position: absolute;
        inset: 0;
        background: linear-gradient(90deg, #00f5dc, #d5ff4d 48.5%, #b773ff);
        border-radius: 8px;
        pointer-events: none;
        transition: all 0.3s ease-out;
        z-index: 0;
      }

      .btn:hover .foreground {
        transform: translateY(-8px);
      }

      .btn:active .foreground,
      .btn:focus .foreground {
        background-color: var(--green-600);
        transform: translateY(-8px);
      }

      .disclaimer p {
        font-size: var(--notes-font-size);
        line-height: var(--notes-line-height);
        margin-bottom: 10px;
      }

      .cf-error-details {
        margin: 40px 0;
        text-align: left;
      }

      .cf-error-details h1 {
        font-size: 18px;
      }

      .cf-error-details li {
        margin-top: 10px;
        line-height: 24px;
      }

      /* Responsiveness */
      @media (max-height: 930px) {
        .container {
          display: block;
          height: auto;
        }
      }
    </style>
  </head>
